const Navbar = () => {
  return <div>

        <div className="flex flex-row justify-between">
          
            <div className="flex row gap-3">
              <p>Home</p>
              <p>+Cart-Icon+ </p>
            </div>
        </div>

  </div>;
};

export default Navbar;
